DROP TABLE IF EXISTS latin_synonyms;
CREATE TABLE latin_synonyms (num INTEGER PRIMARY KEY , lemma TEXT  NOT NULL, pos NOT NULL CHECK(pos in ('n','v','a','s','r')) , syn TEXT NOT NULL, ev TEXT NOT NULL, bidict TEXT, bisense TEXT, monodict TEXT, monosense TEXT, tgr TEXT, gloss TEXT, teqs TEXT, uso TEXT, ex TEXT, stat TEXT, comment TEXT, history TEXT, idmorpho INTEGER DEFAULT '0' not null, modified DATE not null);
